import classes from './Buttons.module.css';

const Buttons = ({text}) => {
  return (
    <div className={classes.BtnContainer}>
      <button className={classes.MainBtn}>Архив заданий регионального этапа ВсОШ по физике</button>
      <button className={classes.MainBtn}>Новости</button>
      <button className={classes.MainBtn}>Документы</button>
    </div>
  ) 
}

export default Buttons;
